import React, { Component } from "react";
import "./AppContent.css";

class AppContent extends Component {
    render(){
        return (
            <main>
              <div className="imageBlur"><img src="https://www.incimages.com/uploaded_files/image/1940x900/getty_663974538_353364.jpg" /></div>
            </main>
          );
    }
}

export default AppContent;
